function Food(name) {
  return <h3>I love eat {name}</h3>;
}

const foodIlike = [
  {
    name: 'soup',
  },
  {
    name: 'sanwich',
  },
  {
    name: 'meat',
  },
];

function App() {
  return (
    <div>
      <h1>Hello</h1>
      {foodIlike.map((dish) => (
        <Food name={dish.name} />
      ))}
    </div>
  );
}

export default App;
